import React from "react";
import HomeButton from "../returnToHomePage";

class LoginEndPage extends React.Component {
    render() {
        return (
            <div>
            <h2>Logged In!</h2>
            <HomeButton/>
            </div>
        )
    }
}

export default LoginEndPage;
